import React from "react";
import DummyCotextProps from "../interfaces/DummyCotextProps";

const defaultState = {
    dummy: [],
};

const DummyContext = React.createContext<DummyCotextProps>(defaultState);

const DummyContextProvider:React.FC= (props) => {
    const [data, setData]
    return (<DummyContext.Provider>{props.children}</DummyContext.Provider>)
}
export default DummyContext;
